import React, { useState } from "react";
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from "reactstrap";

const RIModal = (props) => {
  const { buttonLabel, className } = props;

  const [modal, setModal] = useState(false);
  const toggle = () => setModal(!modal);

  return (
    <div>
      <Button color="danger" onClick={toggle}>
        {buttonLabel}
      </Button>
      <Modal isOpen={modal} toggle={toggle} className={className}>
        <ModalHeader toggle={toggle}>Riesgo Inicial</ModalHeader>
        <ModalBody>
          <img src="https://image.slidesharecdn.com/002emmantenimientoautonomo-150923023729-lva1-app6891/95/002-em-mantenimiento-autonomo-49-638.jpg?cb=1442976043"></img>
        </ModalBody>
      </Modal>
    </div>
  );
};

export default RIModal;
